import bottomup from "@hoge1e3/bottomup";
import * as assert from "assert";
export async function main(){
    let i=0;
    for(let f of bottomup(this.resolve(import.meta.url).up())){
        if(i%10==0){
          await this.echo(f);
          await this.sleep(0);
        }
        if(i++>200)break;
    }
}    
